// @lc code=start
/**
 * @param {string} s
 * @return {string[]}
 */
// 执行超时
var findRepeatedDnaSequences1 = function (s) {
    const all = [], res = [], len = s.length;
    for (let i = 0; i < len - 9; i++) {
        const arr = s.substring(i, i + 10);
        if (all.includes(arr) && !res.includes(arr)) {
            res.push(arr);
        }
        all.push(arr);
    }
    return res;
};
// 哈希
var findRepeatedDnaSequences2 = function (s) {
    const map = new Map, res = [], len = s.length;
    for (let i = 0; i < len - 9; i++) {
        const arr = s.substring(i, i + 10);
        map.set(arr, (map.get(arr) || 0) + 1);
        if (map.get(arr) === 2) { // 只有等于2的时候才推入
            res.push(arr);
        }
    }
    return res;
};
// 哈希 + 滑动窗口 + 位运算
// 题解 https://leetcode-cn.com/problems/repeated-dna-sequences/solution/zhong-fu-de-dnaxu-lie-by-leetcode-soluti-z8zn/
var findRepeatedDnaSequences = function (s) {
    const L = 10;
    const bin = new Map();
    bin.set('A', 0);
    bin.set('C', 1);
    bin.set('G', 2);
    bin.set('T', 3);
    const ans = [];
    const n = s.length;
    if (n <= L) {
        return ans;
    }
    let x = 0;
    for (let i = 0; i < L - 1; ++i) {
        x = (x << 2) | bin.get(s[i]);
    }
    const cnt = new Map();
    for (let i = 0; i <= n - L; ++i) {
        x = ((x << 2) | bin.get(s[i + L - 1])) & ((1 << (L * 2)) - 1);
        cnt.set(x, (cnt.get(x) || 0) + 1);
        if (cnt.get(x) === 2) {
            ans.push(s.slice(i, i + L));
        }
    }
    return ans;
};
// @lc code=end
console.log(findRepeatedDnaSequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"));// ["AAAAACCCCC","CCCCCAAAAA"]
console.log(findRepeatedDnaSequences("AAAAAAAAAAAAA"));// ["AAAAAAAAAA"]
console.log(findRepeatedDnaSequences("AAAAAAAAAAA"));// ["AAAAAAAAAA"]
console.log(findRepeatedDnaSequences("AAAAAAAAA"));// []
console.log(findRepeatedDnaSequences(""));// // []

